import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Header from './Header';
import Home from './Home';
import Product from './Product';
import Store from './Store';

function App() {
  return (
    <Router>
      <div className="app">
          <Switch>
            <Route path='/'>
              <Header />
              <Home />
            </Route>
            <Route path='/checkout'>
              {/* <Header /> */}
            </Route>
            <Route path='/contact'>
              <Product/>
              {/* <Header /> */}
            </Route>
            <Route path='/store'>
              {/* <Header /> */}
              <Store />
            </Route>
          </Switch>
      </div>
    </Router>
  );
}

export default App;
